const Button1 = ({
  variants = "primary",
  size = "medium",
  children,
  type = "button",
  style,
  onClick,
  label,
}) => {
  return (
    <>
      <button
        {...children}
        type={type}
        style={style}
        onClick={onClick}
        className={`btn btn-${variants} btn-${size}`}
      >
        <span>{label}</span>
        {children}
      </button>
    </>
  );
};

export default Button1;
